package ex02연산자;

public class Ex06비교연산자 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int num1 = 10;
		int num2 = 5;
		int num3 = 10;
	
		// 비교연산자의 결과 값은 true or false
		// boolean
		System.out.println(num1 > num2);
		System.out.println(num1 < num2);
		System.out.println(num1 == num3);
		System.out.println(num1 != num3);
		System.out.println(num1 >= num3);
		System.out.println(num1 <= num3);
		
	}

}
